import React from 'react';
import { BrowserRouter as Router } from 'react-router-dom';
import Navbar from './components/Navbar';
import Button from './components/Button';
import ErrorBoundary from './components/ErrorBoundary'; // Importez votre Error Boundary

function App() {
  const handleClick = () => {
    alert('Bouton cliqué!');
  };

  return (
    <Router>
      <ErrorBoundary>
        <Navbar />
        <h1>Bienvenue sur LoveTogether</h1>
        <Button label="Cliquez-moi" onClick={handleClick} />
      </ErrorBoundary>
    </Router>
  );
}

export default App;
